import{_ as d,c as e,o,a6 as r}from"./chunks/framework.BgU7Y2dv.js";const b=JSON.parse('{"title":"VSCode快捷键","description":"VSCode常用快捷键总结，提高开发效率","frontmatter":{"title":"VSCode快捷键","date":"2025-08-21T10:00:00.000Z","tags":["工具","VSCode"],"description":"VSCode常用快捷键总结，提高开发效率","author":"PFinal南丞","keywords":"VSCode, 快捷键, 工具, 开发效率, 编辑器","head":[["meta",{"name":"keywords","content":"VSCode, 快捷键, 工具, 开发效率, 编辑器"}]]},"headers":[],"relativePath":"zh/工具/VSCode快捷键.md","filePath":"zh/工具/VSCode快捷键.md","lastUpdated":1755767605000}'),a={name:"zh/工具/VSCode快捷键.md"};function c(h,t,i,m,l,C){return o(),e("div",{"data-pagefind-body":!0},t[0]||(t[0]=[r('<h1 id="vscode快捷键" tabindex="-1">VSCode快捷键 <a class="header-anchor" href="#vscode快捷键" aria-label="Permalink to &quot;VSCode快捷键&quot;">​</a></h1><p>作为一个开发者，熟练掌握编辑器的快捷键是提高效率的关键。VSCode作为目前最流行的代码编辑器之一，拥有丰富的快捷键功能。本文将为你总结一些最实用的VSCode快捷键，让你的开发效率飞起来。</p><h2 id="通用操作" tabindex="-1">通用操作 <a class="header-anchor" href="#通用操作" aria-label="Permalink to &quot;通用操作&quot;">​</a></h2><table tabindex="0"><thead><tr><th>快捷键</th><th>功能</th></tr></thead><tbody><tr><td><code>Cmd + Shift + P</code></td><td>打开命令面板</td></tr><tr><td><code>Cmd + P</code></td><td>快速打开文件</td></tr><tr><td><code>Cmd + Shift + N</code></td><td>新建窗口</td></tr><tr><td><code>Cmd + N</code></td><td>新建文件</td></tr><tr><td><code>Cmd + W</code></td><td>关闭当前窗口或标签页</td></tr><tr><td><code>Cmd + Shift + T</code></td><td>重新打开关闭的编辑器</td></tr><tr><td><code>Cmd + ,</code></td><td>打开设置</td></tr><tr><td><code>Cmd + K Cmd + S</code></td><td>打开快捷键设置</td></tr></tbody></table><h2 id="编辑操作" tabindex="-1">编辑操作 <a class="header-anchor" href="#编辑操作" aria-label="Permalink to &quot;编辑操作&quot;">​</a></h2><table tabindex="0"><thead><tr><th>快捷键</th><th>功能</th></tr></thead><tbody><tr><td><code>Cmd + X</code></td><td>剪切整行</td></tr><tr><td><code>Cmd + C</code></td><td>复制整行</td></tr><tr><td><code>Cmd + V</code></td><td>粘贴</td></tr><tr><td><code>Cmd + D</code></td><td>选中下一个相同单词</td></tr><tr><td><code>Cmd + Shift + L</code></td><td>选中所有相同单词</td></tr><tr><td><code>Cmd + L</code></td><td>选中整行</td></tr><tr><td><code>Cmd + Shift + K</code></td><td>删除整行</td></tr><tr><td><code>Cmd + Enter</code></td><td>在下方插入新行</td></tr><tr><td><code>Cmd + Shift + Enter</code></td><td>在上方插入新行</td></tr><tr><td><code>Cmd + Shift + \\</code></td><td>跳转到匹配的括号</td></tr><tr><td><code>Cmd + /</code></td><td>注释/取消注释行</td></tr><tr><td><code>Cmd + Option + /</code></td><td>注释/取消注释块</td></tr><tr><td><code>Cmd + K Cmd + C</code></td><td>添加行注释</td></tr><tr><td><code>Cmd + K Cmd + U</code></td><td>删除行注释</td></tr><tr><td><code>Cmd + K Cmd + /</code></td><td>添加/删除块注释</td></tr></tbody></table><h2 id="多光标操作" tabindex="-1">多光标操作 <a class="header-anchor" href="#多光标操作" aria-label="Permalink to &quot;多光标操作&quot;">​</a></h2><table tabindex="0"><thead><tr><th>快捷键</th><th>功能</th></tr></thead><tbody><tr><td><code>Option + 鼠标点击</code></td><td>添加多个光标</td></tr><tr><td><code>Cmd + Option + Up/Down</code></td><td>在上方/下方添加光标</td></tr><tr><td><code>Cmd + U</code></td><td>撤销上一个光标操作</td></tr><tr><td><code>Cmd + Shift + L</code></td><td>选中所有匹配项并添加光标</td></tr></tbody></table><h2 id="导航操作" tabindex="-1">导航操作 <a class="header-anchor" href="#导航操作" aria-label="Permalink to &quot;导航操作&quot;">​</a></h2><table tabindex="0"><thead><tr><th>快捷键</th><th>功能</th></tr></thead><tbody><tr><td><code>Cmd + T</code></td><td>跳转到符号</td></tr><tr><td><code>Cmd + Shift + O</code></td><td>跳转到符号（当前文件）</td></tr><tr><td><code>Cmd + G</code></td><td>跳转到指定行</td></tr><tr><td><code>Cmd + P</code></td><td>快速打开文件</td></tr><tr><td><code>Cmd + Shift + P</code></td><td>打开命令面板</td></tr><tr><td><code>F12</code></td><td>跳转到定义</td></tr><tr><td><code>Option + F12</code></td><td>预览定义</td></tr><tr><td><code>Cmd + K Cmd + P</code></td><td>跳转到匹配的括号</td></tr><tr><td><code>Cmd + Option + Left/Right</code></td><td>后退/前进光标位置</td></tr></tbody></table><h2 id="搜索和替换" tabindex="-1">搜索和替换 <a class="header-anchor" href="#搜索和替换" aria-label="Permalink to &quot;搜索和替换&quot;">​</a></h2><table tabindex="0"><thead><tr><th>快捷键</th><th>功能</th></tr></thead><tbody><tr><td><code>Cmd + F</code></td><td>查找</td></tr><tr><td><code>Cmd + H</code></td><td>替换</td></tr><tr><td><code>Cmd + G</code></td><td>查找下一个</td></tr><tr><td><code>Cmd + Shift + G</code></td><td>查找上一个</td></tr><tr><td><code>Cmd + Option + F</code></td><td>替换当前文件</td></tr><tr><td><code>Cmd + Shift + H</code></td><td>替换整个项目</td></tr><tr><td><code>Cmd + Shift + F</code></td><td>在文件中查找</td></tr></tbody></table><h2 id="代码格式化" tabindex="-1">代码格式化 <a class="header-anchor" href="#代码格式化" aria-label="Permalink to &quot;代码格式化&quot;">​</a></h2><table tabindex="0"><thead><tr><th>快捷键</th><th>功能</th></tr></thead><tbody><tr><td><code>Cmd + Option + F</code></td><td>格式化文档</td></tr><tr><td><code>Cmd + K Cmd + F</code></td><td>格式化选中代码</td></tr><tr><td><code>Cmd + ]</code></td><td>增加缩进</td></tr><tr><td><code>Cmd + [</code></td><td>减少缩进</td></tr></tbody></table><h2 id="文件管理" tabindex="-1">文件管理 <a class="header-anchor" href="#文件管理" aria-label="Permalink to &quot;文件管理&quot;">​</a></h2><table tabindex="0"><thead><tr><th>快捷键</th><th>功能</th></tr></thead><tbody><tr><td><code>Cmd + K S</code></td><td>保存所有文件</td></tr><tr><td><code>Cmd + K Cmd + W</code></td><td>关闭所有编辑器</td></tr><tr><td><code>Cmd + K Cmd + R</code></td><td>在资源管理器中显示当前文件</td></tr><tr><td><code>Cmd + K Cmd + O</code></td><td>在新窗口中打开当前文件</td></tr></tbody></table><h2 id="终端操作" tabindex="-1">终端操作 <a class="header-anchor" href="#终端操作" aria-label="Permalink to &quot;终端操作&quot;">​</a></h2><table tabindex="0"><thead><tr><th>快捷键</th><th>功能</th></tr></thead><tbody><tr><td><code>Ctrl + </code> `</td><td>打开集成终端</td></tr><tr><td><code>Cmd + Shift + </code> `</td><td>创建新终端</td></tr><tr><td><code>Cmd + Shift + C</code></td><td>打开新终端（外部）</td></tr><tr><td><code>Cmd + Shift + V</code></td><td>粘贴到终端</td></tr></tbody></table><h2 id="调试操作" tabindex="-1">调试操作 <a class="header-anchor" href="#调试操作" aria-label="Permalink to &quot;调试操作&quot;">​</a></h2><table tabindex="0"><thead><tr><th>快捷键</th><th>功能</th></tr></thead><tbody><tr><td><code>F5</code></td><td>开始调试</td></tr><tr><td><code>F9</code></td><td>切换断点</td></tr><tr><td><code>F10</code></td><td>单步跳过</td></tr><tr><td><code>F11</code></td><td>单步进入</td></tr><tr><td><code>Shift + F11</code></td><td>单步跳出</td></tr><tr><td><code>Cmd + Shift + F5</code></td><td>重启调试</td></tr><tr><td><code>Shift + F5</code></td><td>停止调试</td></tr></tbody></table><h2 id="git操作" tabindex="-1">Git操作 <a class="header-anchor" href="#git操作" aria-label="Permalink to &quot;Git操作&quot;">​</a></h2><table tabindex="0"><thead><tr><th>快捷键</th><th>功能</th></tr></thead><tbody><tr><td><code>Cmd + Shift + G</code></td><td>打开Git视图</td></tr><tr><td><code>Cmd + Shift + P</code> &gt; <code>Git: Commit</code></td><td>提交更改</td></tr><tr><td><code>Cmd + Shift + P</code> &gt; <code>Git: Push</code></td><td>推送到远程仓库</td></tr><tr><td><code>Cmd + Shift + P</code> &gt; <code>Git: Pull</code></td><td>从远程仓库拉取</td></tr></tbody></table><h2 id="插件和扩展" tabindex="-1">插件和扩展 <a class="header-anchor" href="#插件和扩展" aria-label="Permalink to &quot;插件和扩展&quot;">​</a></h2><table tabindex="0"><thead><tr><th>快捷键</th><th>功能</th></tr></thead><tbody><tr><td><code>Cmd + Shift + X</code></td><td>打开扩展视图</td></tr><tr><td><code>Cmd + Shift + P</code> &gt; <code>Extensions: Install Extensions</code></td><td>安装扩展</td></tr></tbody></table><h2 id="窗口操作" tabindex="-1">窗口操作 <a class="header-anchor" href="#窗口操作" aria-label="Permalink to &quot;窗口操作&quot;">​</a></h2><table tabindex="0"><thead><tr><th>快捷键</th><th>功能</th></tr></thead><tbody><tr><td><code>Cmd + \\</code></td><td>拆分编辑器</td></tr><tr><td><code>Cmd + 1/2/3...</code></td><td>切换到第N个编辑器组</td></tr><tr><td><code>Cmd + K Cmd + Left/Right</code></td><td>将编辑器移动到左侧/右侧组</td></tr><tr><td><code>Cmd + K Cmd + W</code></td><td>关闭所有编辑器组</td></tr></tbody></table><h2 id="书签操作" tabindex="-1">书签操作 <a class="header-anchor" href="#书签操作" aria-label="Permalink to &quot;书签操作&quot;">​</a></h2><table tabindex="0"><thead><tr><th>快捷键</th><th>功能</th></tr></thead><tbody><tr><td><code>Cmd + Option + K</code></td><td>切换书签</td></tr><tr><td><code>Cmd + Option + L</code></td><td>下一个书签</td></tr><tr><td><code>Cmd + Option + J</code></td><td>上一个书签</td></tr></tbody></table><h2 id="折叠和展开" tabindex="-1">折叠和展开 <a class="header-anchor" href="#折叠和展开" aria-label="Permalink to &quot;折叠和展开&quot;">​</a></h2><table tabindex="0"><thead><tr><th>快捷键</th><th>功能</th></tr></thead><tbody><tr><td><code>Cmd + Option + [</code></td><td>折叠代码块</td></tr><tr><td><code>Cmd + Option + ]</code></td><td>展开代码块</td></tr><tr><td><code>Cmd + K Cmd + [</code></td><td>折叠所有子区域</td></tr><tr><td><code>Cmd + K Cmd + ]</code></td><td>展开所有子区域</td></tr><tr><td><code>Cmd + K Cmd + 0</code></td><td>折叠所有区域</td></tr><tr><td><code>Cmd + K Cmd + J</code></td><td>展开所有区域</td></tr></tbody></table><p>这些快捷键涵盖了VSCode的大部分常用功能。熟练掌握它们将大大提高你的编码效率。建议从最常用的快捷键开始练习，逐步熟悉其他功能。</p><h2 id="小贴士" tabindex="-1">小贴士 <a class="header-anchor" href="#小贴士" aria-label="Permalink to &quot;小贴士&quot;">​</a></h2><ol><li><strong>自定义快捷键</strong>：如果你觉得默认快捷键不符合你的习惯，可以在<code>Cmd + K Cmd + S</code>中自定义快捷键。</li><li><strong>使用命令面板</strong>：<code>Cmd + Shift + P</code>是万能的命令面板，几乎所有功能都可以通过它来访问。</li><li><strong>多光标操作</strong>：这是VSCode最强大的功能之一，可以同时编辑多个位置。</li><li><strong>文件搜索</strong>：<code>Cmd + P</code>可以快速搜索和打开文件，支持模糊匹配。</li></ol><p>掌握这些快捷键不仅能提高你的开发效率，还能让你在团队中展现出更专业的技能。快去试试吧！</p>',34)]))}const s=d(a,[["render",c]]);export{b as __pageData,s as default};
